vamos se informar mais sobre problemas psicológicos?

@Frisach2 @tonicarravela El gran problema es ignorar que el "estado del bienestar" tiene sus límites en la capacidad económica de cada país.
El nuestro, lo sobrepasó con creces hace tiempo.
Pretender mantenerlo, y aún expandir su límites es suicida.

